const Header = () => {
  return (
    <div className="header">
      <div>
        <img
          className="logo"
          src="https://thumbs.dreamstime.com/b/fast-food-logo-design-concepts-set-unique-ideas-pizza-kebab-burger-retro-elements-symbols-icons-46091401.jpg"
        />
      </div>
      <div className="nav-items">
        <ul>
          <li>Home🏠</li>
          <li>About🔎 </li>
          <li>Contact☎</li>
          <li>Cart🛒 </li>
        </ul>
      </div>
    </div>
  );
};
const Rescard = (props) => {
  const { resdata } = props;

  const {
    cloudinaryImageId,
    name,
    cuisines,
    avgRatingString,
    sla,
    costForTwo,
  } = resdata?.info;
  return (
    <div className="res-card">
      <span className="tag">promoted</span>
      <img
        className="res-logo"
        alt="res-logo"
        src={
          "https://media-assets.swiggy.com/swiggy/image/upload/fl_lossy,f_auto,q_auto,w_660/" +
          resdata.info.cloudinaryImageId
        }
      />
      <h3>{name}</h3>
      <h4>{cuisines.join(", ")}</h4>
      <h4>{avgRatingString}⭐</h4>
      <h4>{sla.deliveryTime}🕰</h4>
      <h4>{costForTwo}</h4>
    </div>
  );
};

const Body = () => {
  return (
    <div className="body">
      <div className="search">search</div>
      <div className="res-container">
        {resList.map((restraunt) => (
          <Rescard key={restraunt.info.id} resdata={restraunt} />
        ))}
      </div>
    </div>
  );
};
const AppLayout = () => {
  return (
    <div className="app">
      <Header />
      <Body />
    </div>
  );
};
const root = ReactDOM.createRoot(document.getElementById("root"));
root.render(<AppLayout />);
